import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

let dialogs = [
    { id: 1, name: "Leo" },
    { id: 2, name: "Mark" },
    { id: 3, name: "Alf" },
    { id: 4, name: "Bean" },
    { id: 5, name: "Bill" },
];

let messages = [
    { id: 1, message: "Yo" },
    { id: 2, message: "Hi" },
    { id: 3, message: "No way" },
    { id: 4, message: "No doubt" },
    { id: 5, message: "Wait for me!" },
];

let posts = [
    { id: 1, message: "hello", like: 12 },
    { id: 2, message: "I's my first post!", like: 5 },
];

ReactDOM.render(
    <React.StrictMode>
        <App dialogs={dialogs} messages={messages} />
    </React.StrictMode>,
    document.getElementById("root")
);
